import React from 'react';
import {MapTo} from '@adobe/aem-react-editable-components';


export const CustomEditConfig = {
       emptyLabel: 'Header',
       isEmpty: function(props) {
         return !props || !props.logo || !props.name || !props.url;
       }
};

export default function Header(props){
    if (CustomEditConfig.isEmpty(props)) {
        return null;
    }
    return (
        <div className="header">
        Hello
            <h4>{props.logo}</h4>
           <div className="DemoComponent__navbar">
                           {props.link.map(
                               item => (
                                       <ul key={item.id}><h4>{item.name}, {item.url}</h4>

                                       </ul>
                               )
                           )}
                           </div>
        </div>
    );
};


MapTo('spa-react/components/content/header')(Header,CustomEditConfig);
